私の方こそお返事が大変遅くなってしまい、申し訳ございません;;
急な予定変更にも関わらず、体調面お気遣いくださり感謝申し上げます…お恥ずかしい話、未だ感情のコントロールが難しく色々と怠惰な生活を送っています💦小春さんはいかがお過ごしでしょうか…寒さが冬へと突入し年末も近付きリアルも大変な時期ですよね🥲少しでもゆったり出来るお暇ができますことを願っています！美味しいもの、暖かいもの沢山摂取してお過ごし下さいね！
探索度100%流石です…！私はギミックやキャラコン必要なものは全く進められておりません笑是非ご指導願います✨FGOはイベ始まりましたが、全く読めておらず、カズラを5にするか迷い中です🫠

小春さんがお忙しいのもそうですが、私も体調の上下が激しく…お時間や体調などが合えば、是非ナタ探索などご一緒させていただけますと幸いです…;;
モナちゃん仲間！すごい偶然ですね✨最近はフリーナちゃと立場被ってますが、優秀なキャラですよね！キィニチくんは炎神さま待ちでしょうか。。炎キャラや草キャラが増えるたびに強くなりそうな子ですね🌱🔥
お話をして、ティナリの凸を進めることにしました！育成素材とモラが足りないのもありまして笑いつか来てくれる事を願います🦅❄️🔥💪両手剣せめて、天空あれば良かったのですが…マグロもないですし…無念。シロネンちゃんもうすぐで楽しみです岩！！！！

私も最近はお話しする機会が少なかったので、嬉しいです…！感謝です🌸
偏り、やっぱりすごいですよね…実は初回ガチャでモナが来てから、ずっとすり抜け恒常ガチャはモナだったんですよね…可愛いのでオッケーです🪄✨
成程…ディシアさん、2凸しないと炎付着途切れちゃうのですね…難しい💦トーマさんはいらっしゃるので、そちらを育ててみたいと思います！ジン団長、刻晴もまだ先っぽいので、ティナリかディルックですね…調べてみると、ティナリ4凸おすすめらしいので、ディルックさんかティナリで悩みます😭末路閑雲、狩人は未所持です;;

わーーっ空リプに反応していただき、ありがとうございます;;
手持ち恒常はモナ完凸、ティナリ3凸、刻晴1凸、ジン団長無凸って感じです！
あとキィニチくんスルーする気だったのですが、シュヴ引くのに先に来ちゃいました…そうなるとディシアさんですかね🧐？
